CREATE TABLE `students` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `admin_number` varchar(255) COLLATE utf8_unicode_ci NOT NULL,
  `user_id` int(10) unsigned NOT NULL,
  `name` varchar(255) COLLATE utf8_unicode_ci NOT NULL,
  `email` varchar(255) COLLATE utf8_unicode_ci DEFAULT NULL,
  `sex` enum('Male','Female') COLLATE utf8_unicode_ci NOT NULL,
  `religion` enum('Christianity','Islam','Others') COLLATE utf8_unicode_ci NOT NULL,
  `dob` date NOT NULL,
  `date_graduated` date DEFAULT NULL,
  `date_admitted` date NOT NULL,
  `phone` varchar(255) COLLATE utf8_unicode_ci DEFAULT NULL,
  `address` varchar(255) COLLATE utf8_unicode_ci NOT NULL,
  `image` varchar(255) COLLATE utf8_unicode_ci DEFAULT NULL,
  `comment` text COLLATE utf8_unicode_ci,
  `status` enum('active','promoting','promoted','repeating','repeated','left','dismissed','graduated','graduating','deactivated') COLLATE utf8_unicode_ci NOT NULL DEFAULT 'active',
  `classroom_id` int(10) unsigned DEFAULT NULL,
  `house_id` int(10) unsigned NOT NULL,
  `state_id` int(10) unsigned NOT NULL,
  `lga_id` int(10) unsigned NOT NULL,
  `guardian_id` int(10) unsigned DEFAULT NULL,
  `country_id` int(10) unsigned NOT NULL,
  `previous_classroom_id` int(10) unsigned DEFAULT NULL,
  `starting_classroom_id` int(10) unsigned NOT NULL,
  `created_at` timestamp NULL DEFAULT NULL,
  `updated_at` timestamp NULL DEFAULT NULL,
  PRIMARY KEY (`id`),
  UNIQUE KEY `students_admin_number_unique` (`admin_number`),
  UNIQUE KEY `students_email_unique` (`email`),
  UNIQUE KEY `students_phone_unique` (`phone`),
  UNIQUE KEY `students_image_unique` (`image`),
  KEY `students_user_id_foreign` (`user_id`),
  KEY `students_classroom_id_foreign` (`classroom_id`),
  KEY `students_previous_classroom_id_foreign` (`previous_classroom_id`),
  KEY `students_starting_classroom_id_foreign` (`starting_classroom_id`),
  KEY `students_state_id_foreign` (`state_id`),
  KEY `students_lga_id_foreign` (`lga_id`),
  KEY `students_country_id_foreign` (`country_id`),
  CONSTRAINT `students_classroom_id_foreign` FOREIGN KEY (`classroom_id`) REFERENCES `classrooms` (`id`),
  CONSTRAINT `students_country_id_foreign` FOREIGN KEY (`country_id`) REFERENCES `countries` (`id`),
  CONSTRAINT `students_lga_id_foreign` FOREIGN KEY (`lga_id`) REFERENCES `lgas` (`id`),
  CONSTRAINT `students_previous_classroom_id_foreign` FOREIGN KEY (`previous_classroom_id`) REFERENCES `classrooms` (`id`),
  CONSTRAINT `students_starting_classroom_id_foreign` FOREIGN KEY (`starting_classroom_id`) REFERENCES `classrooms` (`id`),
  CONSTRAINT `students_state_id_foreign` FOREIGN KEY (`state_id`) REFERENCES `states` (`id`),
  CONSTRAINT `students_user_id_foreign` FOREIGN KEY (`user_id`) REFERENCES `users` (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=534 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;
